On Jan 20 he will slink out the back door of the White House and Joe Biden will walk in the front door

In the interim, take a little time every day, reply to one of Trump’s rage tweets and remind him how much of a loser he is🤭 https://t.co/gRgZuEuIQy

@kurotohatesyou -the incident just like that was enough to make Kiriya seething with rage.

